import React from 'react';

function Navbar() {
  return (
    <div>
      <ul className="navbar">
        <li>
          <a href="#about">About Me</a>
        </li>
        <li>
          <a href="#projects">Projects</a>
        </li>
        <li>Ethics</li>
        <li>Reach Out</li>
      </ul>
    </div>
  );
}

export default Navbar;
